css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #7e8789;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #003745;
  background-color: #00232c;
}
.github-tab-icon {
  color: #384f55;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #1a353d;
  border-radius: 2px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #ffffff;
  box-shadow: 0 1px 0 #005469;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #a8a8a8;
}
